/** DEFINES **/


//extract low byte of uint16 keycode
#define LB(n) ((uint8_t)((n) & 0x00FF))
//extract low nibble of high byte of the keycode & shift to low nibble of low byte
#define HB1_L(n) (((n) & 0x0F00)>>8)
//extract low nibble of high byte of the keycode & shift to high nibble of low byte
#define HB1_H(n) (((n) & 0x0F00)>>4)
//extract LSB of high nibble and shift to a position in an uint8_t
#define HB2(n,s) (((n) & 0x0100)>>(12-s))

//reverse HB1_L macro, read byte from flash
#define RHB1_L(n) ((pgm_read_byte_near(n)&0x0F) << 8)
//reverse HB1_H macro, read byte from flash
#define RHB1_H(n) ((pgm_read_byte_near(n)&0xF0) << 4)
//reverse HB2 macro, read byte from flash
#define RHB2(n,s) (((pgm_read_byte_near(n)) & (1<<s))<<(12-s))
//read one byte from flash (reverse LB macro)
#define RLB(n) (pgm_read_byte_near(n))

/**
 * 2x 96 elements -> 192 elements
 * 
 * Region 1: South&North America:
 * 2x8bits
 * 7x13bits
 * 14bytes, 2688Bytes
 * 
 * LAYOUT_US_ENGLISH
 * LAYOUT_US_INTERNATIONAL
 * LAYOUT_CANADIAN_FRENCH
 * LAYOUT_CANADIAN_MULTILINGUAL
 * LAYOUT_PORTUGUESE
 * LAYOUT_TURKISH
 * LAYOUT_PORTUGUESE_BRAZILIAN
 * LAYOUT_UNITED_KINGDOM
 * LAYOUT_SPANISH_LATIN_AMERICA
 * 
 * Region 2: North&South Europe
 * 1x8
 * 8x13
 * 14 bytes, 2688 Bytes
 * 
 * LAYOUT_US_ENGLISH
 * LAYOUT_US_INTERNATIONAL
 * LAYOUT_SPANISH
 * LAYOUT_DANISH
 * LAYOUT_FINNISH
 * LAYOUT_SWEDISH
 * LAYOUT_ICELANDIC
 * LAYOUT_IRISH
 * LAYOUT_NORWEGIAN
 * 
 * Region 3: Middle Europe
 * 2x8
 * 7x13
 * ~13bytes, 2496Bytes
 * 
 * LAYOUT_US_ENGLISH
 * LAYOUT_US_INTERNATIONAL
 * LAYOUT_FRENCH
 * LAYOUT_FRENCH_BELGIAN
 * LAYOUT_FRENCH_SWISS
 * LAYOUT_GERMAN
 * LAYOUT_GERMAN_MAC
 * LAYOUT_GERMAN_SWISS
 * LAYOUT_ITALIAN
 * 
 * US,UK,IT -> 8bit keymaps
*/

/** type of one keycode, 14bytes */
typedef struct keycodeType14 {
        uint8_t b1;
        uint8_t b2;
        uint8_t b3;
        uint8_t b4;
        uint8_t b5;
        uint8_t b6;
        uint8_t b7;
        uint8_t b8;
        uint8_t b9;
        uint8_t b10;
        uint8_t b11;
        uint8_t b12;
        uint8_t b13;
        uint8_t b14;
} KEYCODE_TYPE_REGION_14;

/** type of one keycode, 13bytes */
typedef struct keycodeType13 {
        uint8_t b1;
        uint8_t b2;
        uint8_t b3;
        uint8_t b4;
        uint8_t b5;
        uint8_t b6;
        uint8_t b7;
        uint8_t b8;
        uint8_t b9;
        uint8_t b10;
        uint8_t b11;
        uint8_t b12;
        uint8_t b13;
        uint8_t b14;
} KEYCODE_TYPE_REGION_13;

